INSERT INTO filth.movie VALUES (4184, 'The Babadook', 2014, '***½', 'NR', 'Australia', 'This is what horror movies should be. It is very smart, very well shot and acted, well written, great sound and production design, and above all else didn''t resort to cheap scare tactics and sex and gore. And it''s actually scary. Essie Davis hand-down should have been nominated for her performance. The only grievances I have is that the pacing wasn''t as good as it could have been--a consistent incline would be perfect but it dragged slightly somewhere in the middle. Also, it seemed to have two climaxes back-to-back, which I thought was unnecessary. It''s a brilliant metaphor for depression and grief, or anything mentally dehabilitating. I''ve been going back and forth between ***½ and ****.', 'tt2321549', NULL, 242224, NULL, NULL, 93);
