INSERT INTO filth.movie VALUES (4261, 'Dunkirk', 2017, '****', 'PG-13', 'England', 'Amazing example of tension; tension from beginning to end--the score being the major contributing factor. No violence for the sake of violence. Virtually no blood and gore. The storry is unfolded non-linearly (but is not obvious about it), which forces you to pay attention. Great setting with nice consistent cinematography and de-saturated color palette--it''s almost a black-and-white movie in color. From frame one you''re right in the middle of it. There''s no character development nor much character depth, but it really works with this movie because of the event that it''s trying to recreate.', 'tt5013056', 1, 374720, NULL, NULL, 106);
INSERT INTO filth.movie VALUES (4262, 'Get Out', 2017, '***', 'R', 'USA', 'This is good, but a little frustrating. Up until a certain point it is a great allegory/social commentary on white racism against African-Americans through American history. However, it takes a turn that kind of betrays that original line of thought for the worse. Up until that point, however, it is very good.', 'tt5052448', 0, 419430, NULL, NULL, 104);
